import './App.css';
import SignIn from './component/SignIn';
import { auth } from './firebase';
import {useAuthState} from 'react-firebase-hooks/auth'
import Chat from './component/Chat';

function App() {
  const [user] = useAuthState(auth);
  return (
    <div className="App">
      <header className="App-header">
        {user ? <Chat /> : <SignIn />}
      </header>
    </div>
  );
}

export default App;
